import React, { Component } from 'react'
import data from "./data"

const ProformaItemList = data.proformaItem;

class ProformaItem extends Component {
    render() {
        return(
            <ul>
                {ProformaItemList.map(p => (<li>{p}</li>))}
            </ul>
        )
    }
}
export default ProformaItem
